const MainBanner1 = () =>{
    return(
        <>
        <div className="content-layout-left">
            <div className="content-1">
                <p>Sell, buy, discover and collect NFT</p>
            </div>
            <div className="content-2">
                <p>A maketplace for people to buy and sell unique, single-edition digital artwork from over 6500 artists.</p>
            </div>
            <div className="content-3">
                <button type="button" className="button button-content-1">
                    <p>Explore now</p> 
                </button>
            </div>
        </div>
        </>
    )
};
export default MainBanner1;
